w"}},{"name":"rxc","Notes":"As multiplication is commutative, reversing the order and multiplying the row array by the column array results in the same 8x4 result.","DiagramX":90,"DiagramY":390,"HideInfo":"y","DiagramNotes":"y","Type":"Expression","Formula":{"Formula":"row*col"}},{"name":"dot","Notes":"The dot function does matrix multiplication of the two arguments.\n\nThe nontechnical Wikipedia definition of a matrix multiplication result is \"a matrix whose elements are found by multiplying the elements of the same row from the first matrix times the associated elements of the same column from the second matrix and summing\".\n\nIn this case matrix multiplying the column array times the row array results in the same 8x4 matrix as the normal multiplication yielded.  This is because the number of columns in the first argument and rows in the second argument are 1, so the summation takes place over a single cell.\n\nMatrix multiplication is not commutative and in this case a matrix multiplication of the row array by the column array would be illegal since the number of columns of the first must equal the number of rows of the second.\n\nSee the mmult expression for an example of using the dot function on actual matrices.","DiagramX":195,"DiagramY":305,"HideInfo":"y","DiagramNotes":"n","Type":"Expression","Formula":{"Formula":"{dot col, row}"}},{"name":"cDotC","Notes":"By taking the transpose of the column array, we can use the dot function to matrix multiply it by it's untransposed self.  The result is a scalar.","DiagramX":195,"DiagramY":335,"HideInfo":"y","DiagramNotes":"y","Type":"Expression","Formula":{"Formula":"{dot {tr col}, col}"}},{"name":"col2","Notes":"A column array with elements 2 and 3","DiagramX":90,"DiagramY":445,"HideInfo":"y","DiagramNotes":"y","Type":"Expression","Formula":{"Formula":"2:3"}},{"name":"mmult","Notes":"The dot function is used to matrix multiply a 4x3 matrix by a 3x2 matrix, yielding a 4x2 result.\n\nUnits are honoured in matrix multiplication as with other multiplications.\n\nIn this case multiplying a newton by a meter results in a joule, but the SI unit set uses kilojoules as the default output, so the numbers are smaller by a factor of a 1000 than if units hadn't been used.\n\nOf course you can set the display unit to a different energy unit if you wish.","DiagramX":190,"DiagramY":515,"HideInfo":"y","DiagramNotes":"y","Type":"Expression","Formula":{"Formula":"{dot A, B}"}},{"name":"col2X","Notes":"An example of multiplying a matrix by a column matrix that has fewer rows.","DiagramX":195,"DiagramY":395,"HideInfo":"y","DiagramNotes":"y","Type":"Expression","Formula":{"Formula":"col2*rxc"}},{"name":"row2X","Notes":"An example of multiplying a matrix by a row matrix that has fewer columns.","DiagramX":195,"DiagramY":465,"HideInfo":"y","DiagramNotes":"y","Type":"Expression","Formula":{"Formula":"{transpose col2}*rxc"}},{"name":"expectedcxr","Notes":"","DiagramX":200,"DiagramY":200,"HideInfo":"y","DiagramNotes":"n","Type":"Matrix","CellInputs":{"0_0":"0","1_1":"11","1_2":"12","1_3":"13","1_4":"14","2_1":"22","2_2":"24","2_3":"26","2_4":"28","3_1":"33","3_2":"36","3_3":"39","3_4":"42","4_1":"44","4_2":"48","4_3":"52","4_4":"56","5_1":"55","5_2":"60","5_3":"65","5_4":"70","6_1":"66","6_2":"72","6_3":"78","6_4":"84","7_1":"77","7_2":"84","7_3":"91","7_4":"98","8_1":"88","8_2":"96","8_3":"104","8_4":"112"},"rowCount":"8","columnCount":"4"},{"name":"cxrErrors","Notes":"","DiagramX":200,"DiagramY":235,"HideInfo":"y","DiagramNotes":"n","Type":"Expression","Formula":{"Formula":"{ne cxr, expectedCxr}"}},{"name":"rxcErrors","Notes":"","DiagramX":200,"DiagramY":260,"HideInfo":"y","DiagramNotes":"n","Type":"Expression","Formula":{"Formula":"{ne rxc, expectedCxr}"}},{"name":"expectedDot","Notes":"","DiagramX":275,"DiagramY":280,"HideInfo":"y","DiagramNotes":"n","Type":"Matrix","CellInputs":{"0_0":"0","1_1":"11","1_2":"12","1_3":"13","1_4":"14","2_1":"22","2_2":"24","2_3":"26","2_4":"28","3_1":"33","3_2":"36",